# -*- coding: utf-8 -*-
from odoo import api, fields, models, _
from odoo.exceptions import ValidationError


class AuditRiskAssertion(models.Model):
    _name = "audit.risk.assertion"
    _description = "Assertion-Level Risk"
    _inherit = ["mail.thread", "mail.activity.mixin"]
    _order = "engagement_id, account_area, id"

    engagement_id = fields.Many2one(
        "audit.engagement",
        string="Engagement",
        required=True,
        ondelete="cascade",
        index=True,
    )
    fs_risk_id = fields.Many2one("audit.risk.fs", string="FS Risk", ondelete="cascade")
    account_area = fields.Selection(
        [
            ("revenue", "Revenue"),
            ("receivables", "Receivables"),
            ("inventory", "Inventory"),
            ("ppe", "PPE"),
            ("liabilities", "Liabilities"),
            ("equity", "Equity"),
            ("expenses", "Expenses"),
            ("cash", "Cash & Bank"),
            ("other", "Other"),
        ],
        string="Account / Cycle",
        required=True,
    )
    assertion_tag_ids = fields.Many2many("audit.assertion.tag", string="Assertions", required=True)
    inherent_likelihood = fields.Integer(string="Inherent Likelihood", default=1)
    inherent_magnitude = fields.Integer(string="Inherent Magnitude", default=1)
    control_risk = fields.Integer(string="Control Risk", default=1)
    detection_risk = fields.Integer(string="Detection Risk", default=1)
    combined_score = fields.Integer(string="Combined Risk", compute="_compute_combined", store=True)
    risk_level = fields.Selection(
        [
            ("low", "Low"),
            ("moderate", "Moderate"),
            ("high", "High"),
        ],
        string="Risk Band",
        compute="_compute_combined",
        store=True,
    )
    significant_risk = fields.Boolean(string="Significant", compute="_compute_combined", store=True)
    response_strategy = fields.Selection(
        [
            ("tests_of_controls", "Tests of Controls"),
            ("substantive", "Substantive Procedures"),
            ("combined", "Combined"),
        ],
        string="Response Strategy",
        required=True,
    )
    reliance_on_controls = fields.Boolean(string="Control Reliance")
    test_of_controls_required = fields.Boolean(string="ToC Required", compute="_compute_combined", store=True)
    override_justification = fields.Text(string="Override Justification")
    procedures_note = fields.Text(string="Planned Procedures", required=True)

    @api.depends("inherent_likelihood", "inherent_magnitude", "control_risk", "detection_risk", "response_strategy")
    def _compute_combined(self):
        for record in self:
            il = record.inherent_likelihood or 0
            im = record.inherent_magnitude or 0
            cr = record.control_risk or 0
            dr = record.detection_risk or 0
            record.combined_score = il * im * cr * dr
            record.risk_level = record._band_from_score(record.combined_score)
            record.significant_risk = record.risk_level == "high"
            record.test_of_controls_required = record.reliance_on_controls and record.risk_level in {"moderate", "high"}

    def _band_from_score(self, score):
        if score >= 151:
            return "high"
        if score >= 51:
            return "moderate"
        return "low"

    @api.constrains(
        "inherent_likelihood",
        "inherent_magnitude",
        "control_risk",
        "detection_risk",
    )
    def _check_scales(self):
        for record in self:
            record._ensure_scale(record.inherent_likelihood, "Inherent likelihood")
            record._ensure_scale(record.inherent_magnitude, "Inherent magnitude")
            record._ensure_scale(record.control_risk, "Control risk")
            record._ensure_scale(record.detection_risk, "Detection risk")

    def _ensure_scale(self, value, label):
        if value is None:
            raise ValidationError(_("%s must be between 1 and 5.") % label)
        if value < 1 or value > 5:
            raise ValidationError(_("%s must be between 1 and 5.") % label)

    def action_create_fs_link(self):
        for record in self:
            if record.fs_risk_id:
                continue
            fs_risk = self.env["audit.risk.fs"].create(
                {
                    "engagement_id": record.engagement_id.id,
                    "name": f"Auto risk from {record.account_area}",
                    "professional_judgment": record.procedures_note,
                    "planned_response": record.procedures_note,
                }
            )
            record.fs_risk_id = fs_risk.id
